import React from "react";
import Header from "../../../Components/Header";
import { Body, CardLogin, Logo } from "./styled";
import lnd from "../../../assets/img/LND_2.png"



const Login = () => {


    return(
        <Body>
            <CardLogin>
                <Logo src={lnd}/>
            </CardLogin>
        </Body>
    )

}

export default Login;
